import { WebView } from "react-native-webview";
import React, { Component } from "react";
export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = { val: 1 };
  }

  render() {
    return (
      <WebView
        style={{ flex: 1 }}
        originWhitelist={["*"]}
        source={{ uri: "https://aboutreact.com" }}
        style={{ marginTop: 20 }}
        javaScriptEnabled={true}
        domStorageEnabled={true}
      />
    );
  }
}
